import React from 'react';
import '../css/Main.css'
import 'bootstrap/dist/css/bootstrap.css';
import {Link} from 'react-router-dom';

function main () {
    return(
        <div className="MainButtons" >
            <button onClick={toHome}  type="button" class="btn btn-warning btn-lg" >Login</button>
            <button id="RegisterButton" type="button" class="btn btn-warning btn-lg">Register</button>
        </div>      
        
    );
    
}

const toHome =() =>{
    <Link to="/homeP" />
}

export default main;
